import React from 'react'

function MainContent({ stories }) {

    return (
        <div className="table">
            {stories.map((story) => (
                <tbody>
                    <tr key={story.id}>
                        <td>{story.by}</td>
                        <td>{story}</td>
                        <td></td>
                        <td></td>
                    </tr>
                </tbody>
            ))}
        </div>
    )
}

export default MainContent
